import React from "react";
import { Button, RadioGroup, FormControl, FormLabel, Sheet } from "@mui/joy";
import CheckCircleRoundedIcon from '@mui/icons-material/CheckCircleRounded';
import Radio, { radioClasses } from "@mui/joy/Radio";

export default function PageOne() {
  return (
    <FormControl>
      <FormLabel color="text">What is your goal?</FormLabel>
      <RadioGroup
        sx={{
          flexDirection: "row",
          gap: 2,
          [`& .${radioClasses.checked}`]: {
            [`& .${radioClasses.action}`]: {
              inset: -1,
              border: "3px solid",
              borderColor: "primary.500",
            },
          },
          [`& .${radioClasses.radio}`]: {
            display: "contents",
            "& > svg": {
              zIndex: 2,
              position: "absolute",
              top: "-8px",
              right: "-8px",
              bgcolor: "background.surface",
              borderRadius: "50%",
            },
          },
        }}
      >
        {["Website", "Documents", "Social Account"].map((value) => (
          <Sheet
            key={value}
            variant="outlined"
            sx={{
              borderRadius: "md",

              boxShadow: "sm",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              gap: 1.5,
              p: 2,
              minWidth: 120,
            }}
          >
            <Radio
              id={value}
              value={value}
              checkedIcon={<CheckCircleRoundedIcon />}
            />
            <FormLabel htmlFor={value}>{value}</FormLabel>
          </Sheet>
        ))}
      </RadioGroup>
    </FormControl>
  );
}
